import React from 'react';
import {
  View,
  Text,
  Button,
  StyleSheet,
  TouchableOpacity
} from 'react-native';
import { AntDesign } from '@expo/vector-icons'; 
import { MaterialIcons } from '@expo/vector-icons'; 
import { MaterialCommunityIcons } from '@expo/vector-icons'; 
import { FontAwesome } from '@expo/vector-icons'; 

import DefaultText from './DefaultText';
import Colors from '../constants/Colors';

const MealItem = props => {


  const deleteHistory = (id) => {
    // fetch('http://0.0.0.0:5000/deleteOrder', {
    //   headers: {
    //     'Accept': 'application/json',
    //     'Content-Type': 'application/json',
    //   },
    //   method: 'POST',
    //   body: JSON.stringify({
    //     id:id
    //  })
    // })
    // .then((response) => response.json())
    // .then((responseJson) => {
    //   console.log(responseJson);
    // })
    // .catch((error) => {
    //   console.error(error);
    //   alert("Delete Order Error");

    // });
  }


  var itemIcon = <MaterialCommunityIcons name="train-car" size={24} color={Colors.primaryColor} /> 
    if (props.item === 'car'){
      itemIcon = <AntDesign name="car" size={25} color= {Colors.primaryColor} />
    }
    else if (props.item === 'train'){
      itemIcon = <MaterialIcons name="train" size={24} color= {Colors.primaryColor} />
    }
    else if (props.item === 'bus'){
      itemIcon = <MaterialIcons name="directions-bus" size={24} color={Colors.primaryColor} />    }

    else if (props.item === 'aeroplane'){
      itemIcon = <FontAwesome name="plane" size={24} color= {Colors.primaryColor} />
    }
  return (
    <View style={styles.mealItem}>
        <View style={{ ...styles.mealRow, ...styles.mealDetail }}>

          <View style={{flex: 1, flexDirection: 'row', paddingHorizontal: 5}}>
            {itemIcon}
            <Text> Date : {props.date} </Text>
          </View>
          <View style={{flex: 1, flexDirection: 'row', paddingHorizontal: 5}}>
            <Text> Type : {props.type} </Text>
            <Text>Item : {props.item} </Text>
          </View>
          <View style={{flex: 1, flexDirection: 'row', paddingHorizontal: 5}}>

          <Text> Time : {props.time} </Text> 
          <Text> Cost : {props.cost} </Text>
          </View>

        </View>
        <View style={styles.actionIcons}>
          <TouchableOpacity
            onPress={deleteHistory(props.id)}
          >
          <MaterialIcons name="change-history" size={24} color={Colors.primaryColor} />
         </TouchableOpacity>
         <TouchableOpacity
            onPress={deleteHistory(props.id)}
          >
         <MaterialIcons name="delete" size={24} color={Colors.primaryColor} />
         </TouchableOpacity>
        </View>
    </View>
  );
};

const styles = StyleSheet.create({
  mealItem: {
    height: 200,
    width: '100%',
    backgroundColor: '#E7FFE1',
    borderRadius: 10,
    overflow: 'hidden',
    marginVertical: 10
  },
  bgImage: {
    width: '100%',
    height: '100%',
    justifyContent: 'flex-end',
  },
  mealRow: {
    flexDirection: 'row'
  },
  mealHeader: {
    height: '85%'
  },
  mealDetail: {
    paddingHorizontal: 10,
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '15%'
  },
  titleContainer: {
    backgroundColor: 'green',
    paddingVertical: 5,
    paddingHorizontal: 12
  },
  actionIcons:{
    justifyContent: 'right',
    alignItems: 'right'
  },
  title: {
    fontFamily: 'open-sans-bold',
    fontSize: 20,
    color: 'white',
    textAlign: 'center'
  },
  buttons: {
    elevation: 8,
    backgroundColor: "green",
    borderRadius: 5,
    margin:5,
    paddingVertical: 10,
    paddingHorizontal: 12
  },
});

export default MealItem;
